sys_variable_value.value:
(function execute(inputs, outputs) {

  var rec = new GlideRecord('sys_choice');
  rec.addQuery('name', 'incident');
  rec.addQuery('element', 'x_vmw_ws1uem_ws1action');
  rec.addQuery('value', inputs.ws1input);
  rec.query();
  rec.next();

  outputs.ws1text = rec.getDisplayValue();

})(inputs, outputs);

